/*Table structure for table `t_invite` */

DROP TABLE IF EXISTS `t_invite`;

CREATE TABLE `t_invite` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `qr_id` varchar(45) DEFAULT NULL,
  `company` varchar(50) DEFAULT NULL,
  `no_sk` varbinary(20) DEFAULT NULL,
  `iuran` int(11) DEFAULT NULL,
  `nama` varchar(50) DEFAULT NULL,
  `post` varchar(50) DEFAULT NULL,
  `foto` varchar(50) DEFAULT NULL,
  `jabatan` varchar(30) DEFAULT NULL,
  `ket` varchar(45) DEFAULT NULL,
  `flag_in` int(11) DEFAULT '0',
  `no_kontak` varchar(20) DEFAULT NULL,
  `create_date` date DEFAULT NULL,
  `create_by` varchar(10) DEFAULT NULL,
  `update_date` date DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=latin1;

